(1, 2, 'Which of the following best describes how IPv6 over MPLS is typically implemented?', 'co2', 'By using 6PE (IPv6 Provider Edge) routers to carry IPv6 traffic over an MPLS core.', 'By encapsulating IPv6 packets in IPv4 tunnels before sending them over MPLS.', 'By modifying LDP (Label Distribution Protocol) to support IPv6 addresses.', 'By replacing MPLS with IPv6-native forwarding mechanisms.', 'By using 6PE (IPv6 Provider Edge) routers to carry IPv6 traffic over an MPLS core.', 'active', 'Null'),
(2, 2, 'In a wireless LAN using IEEE 802.11, what is the function of the RTS/CTS (Request to Send / Clear to Send) mechanism?', 'co2', 'To manage multiple access in an ad-hoc network.', 'To prevent hidden terminal problems in a contention-based medium.', 'To increase the transmission speed beyond 54 Mbps.', 'To enforce time-division multiplexing for multiple users.', 'To prevent hidden terminal problems in a contention-based medium.', 'active', 'Null'),
